import React from "react";
import "../App.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTimesCircle, faEdit } from "@fortawesome/free-solid-svg-icons";

function List(props) {
    var data = props.data;

    if (data.length > 0) {
        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Platform</th>
                            <th>Year</th>
                            <th>Global Sales</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map((item, i) => (
                            <tr key={i}>
                                <td>{item.Name}</td>
                                <td>{item.Platform}</td>
                                <td>{item.Year}</td>
                                <td>{item.Global_Sales}</td>
                                <td>
                                    <FontAwesomeIcon icon={faTimesCircle} />
                                </td>
                                <td>
                                    <FontAwesomeIcon icon={faEdit} />
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        );
    } else {
        return null;
    }
}

export default List;
